from difflib import SequenceMatcher
def similar(a, b):
    return SequenceMatcher(None, a, b).ratio()
def search_tname(query):
    T = sc.textFile('Bigdata/Project/II_meta/Tname.out')
    query = query.strip('*')
    collist = T.filter(lambda x: re.match(r'^.*'+query+'.*\t.*',x.lower())).map(lambda x:(x.split('\t')[0],x.split('\t')[1]))
    return collist.map(lambda x:(x[1],similar(x[0],query))).sortBy(lambda x:-x[1])

