def search_category(queries):
    T = sc.textFile('Bigdata/Project/II_meta/category.out')
    flag = True
    for query in queries:
        query = query.lower()
        if flag:
            expression = '(^.*'+query+'.*\t.*)'
            flag = False
        else:
            expression = expression + '|(^.*'+query+'.*\t.*)'

    collist = T.filter(lambda x: re.match(r''+expression,x.lower()))
    return collist.flatMap(lambda x:x.split('\t')[1].split(';;')).sortBy(lambda x: x).map(lambda x: (x,1))

